import logo from './logo.svg';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Avatar from '@material-ui/core/Avatar';
import { makeStyles } from '@material-ui/core/styles';

const [teamMembers, setTeamMembers] = ['Taylor Clark', 'Delvin Hall', 'Nishant Seth', 'Chad Gabrysch', 'Chris Soloman', 'Linda Stewart', 'Cris Sakae', 'Kristin Erikson', 'Brian Denholm', 'Jourdan McClish']
const [selectedTeamMember, setSelectedTeamMember] = '';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    '& > *': {
      margin: theme.spacing(1),
    },
  },
  small: {
    width: theme.spacing(3),
    height: theme.spacing(3),
  },
  large: {
    width: theme.spacing(7),
    height: theme.spacing(7),
  },
}));

function App() {
  const classes = useStyles();
  return (
    <div className="App">
      <header>
        McLaren Randomizer
      </header>
      <Grid container spacing={3}>
        <Grid item xs={6}>
          <Avatar alt="Remy Sharp" src='https://avataaars.io/?avatarStyle=Circle&topType=LongHairNotTooLong&accessoriesType=Prescription02&hairColor=Blonde&facialHairType=Blank&clotheType=Hoodie&clotheColor=Heather&eyeType=Squint&eyebrowType=Default&mouthType=Smile&skinColor=Pale' className={classes.large} />
        </Grid>
        <Grid item xs={6}>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
